import "./Navbar.css";

const Navbar = () => {
  const navigations = [
    {
      name: "About",
      url: "about.html",

      subLinks: [
        {
          name: "Legacy & Milestones",
          url: "about.html#Legacy",

          subLink: [
            {
              name: "About",
              url: "#",
            },
            {
              name: "About",
              url: "#",
            },
          ],
        },

        {
          name: "Legacy & Milestones",
          url: "about.html#Legacy",

          subLink: {
            name: "About",
            url: "#",
          },
        },
      ],
    },

    {
      name: "Specialties",
      url: "about.html",

      subLinks: [
        {
          name: "Legacy & Milestones",
          url: "about.html#Legacy",

          subLink: [
            {
              name: "About",
              url: "#",
            },
            {
              name: "About",
              url: "#",
            },
          ],
        },

        {
          name: "Legacy & Milestones",
          url: "about.html#Legacy",

          subLink: {
            name: "About",
            url: "#",
          },
        },
      ],
    },
  ];

  return (
    <header class="main-header">
      <div class="header-sticky">
        <nav class="navbar navbar-expand-lg">
          <div class="container">
            <a class="navbar-brand" href="https://www.mrityunjayhospital.com">
              <img
                // src="images/mh-logo.png"
                src="https://sangeetamedicalcentre.com/wp-content/uploads/2023/08/Asset-4.png"
                alt="Mrityunjay Orthopaedic Hospital Logo"
                style={{ width: "200px" }}
              />
            </a>

            <div class="collapse navbar-collapse main-menu">
              <div class="nav-menu-wrapper">
                <ul class="navbar-nav mr-auto" id="menu">
                  {navigations?.map((navigation) => (
                    <li class="nav-item submenu">
                      <a
                        class="nav-link"
                        href={navigation?.url}
                        title="About Mrityunjay Hospital Meerut"
                      >
                        {navigation?.name}
                      </a>

                      {navigation?.subLinks && (
                        <ul class="sub-menu">
                          {navigation?.subLinks?.map((sublink) => (
                            <li class="nav-item">
                              <a class="nav-link" href={sublink?.name}>
                                {sublink?.name}
                              </a>
                              {sublink?.subLink && (
                                <ul class="sub-menu">
                                  {sublink?.subLink?.map((sublink2) => (
                                    <>
                                      <li class="nav-item">
                                        <a
                                          class="nav-link"
                                          href={sublink2?.name}
                                        >
                                          {sublink2?.name}
                                        </a>
                                      </li>
                                    </>
                                  ))}
                                </ul>
                              )}
                            </li>
                          ))}
                        </ul>
                      )}
                    </li>
                  ))}
                </ul>
              </div>
              <div class="header-btn d-inline-flex">
                <a href="contact.html#Appointment" class="btn-default">
                  <span>Appointment</span>
                </a>
              </div>
            </div>
            <div class="navbar-toggle"></div>
          </div>
        </nav>
        <div class="responsive-menu"></div>
      </div>
    </header>
  );
};

export default Navbar;
